import { moveiService } from '../services/movieService'

export function MoveiList() {
    const [movies, setmovies] = useState([])
    useEffect(async () => {
        const resolte = await moveiService.query()
        console.log('resolte is:', resolte);
        setmovies(resolte)
    }, [])
    return (
        <div className="main-container">

        </div>
    )
}
